import React from "react";

const Gift = () => {
	return (
		<section className="bg-specialBg py-24">
      <div className="heading flex items-center justify-center flex-col gap-6">
        <h2 className="font-Handwrite text-3xl">Wonderfull Gifts</h2>
        <h1 className="font-serif text-5xl uppercase">Our Wonderfull Arrangements</h1>
      </div>
      <div className="container mx-auto grid grid-cols-4 gap-4 mt-12">
        <div className="card text-center">
          <img src="Images\img08.jpg" className="w-full h-full" alt="" />
          <span className="font-serif my-4 text-lg uppercase block">Orange Slik</span>
          <p className="text-gray-400">$350.00</p>
        </div>
      </div>
    </section>
	);
};

export default Gift;
